package app.model.data;

import java.util.ArrayList;
import java.util.List;

public class TableBean {

	List<String> attributeNameList;
	List<List<String>> rowList;

	public TableBean() {
		super();
		// TODO Auto-generated constructor stub
	}

	public TableBean(List<String> attributeNameList, List<List<String>> rowList) {
		super();
		this.attributeNameList = attributeNameList;
		this.rowList = rowList;
	}

	public List<String> getAttributeNameList() {
		if (attributeNameList == null) {
			attributeNameList = new ArrayList<String>();
		}
		return attributeNameList;
	}

	public void setAttributeNameList(List<String> attributeNameList) {
		this.attributeNameList = attributeNameList;
	}

	public List<List<String>> getRowList() {
		if (rowList == null) {
			rowList = new ArrayList<List<String>>();
		}
		return rowList;
	}

	public void setRowList(List<List<String>> rowList) {
		this.rowList = rowList;
	}

}
